import { BrowserRouter } from 'react-router-dom';
import './App.css';
import BusTicketBooking from './BusTicketBooking/BusTicketBooking';
import SearchTicket from './SearchTicket/SearchTicket';

function App() {
  return (
    <>

      <div className="App">
        <button>Log In</button>
        <button>Sign Up</button>
        <BrowserRouter>
          <BusTicketBooking />
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
